LengthWhile   NestWhile     NestWhileList TakeWhile     While

LengthWhile[list, crit] gives the number of continuous elements e
                                                                 i
     starting at the beginning of list for which crit[e ] is True.
                                                       i

TakeWhile[list, crit] gives elements e
