(fe_formalElement)[weights] := keys[fe[[1]]]
 
(fe_formalElement)[multiplicities] := values[fe[[1]]]
 
(fe_formalElement)[hashtable] := fe[[1]]
 
(x_formalElement) == (y_formalElement) ^:= x[weights] == y[weights] && 
